INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2024/12/31 11:59:59", 2.17, 0, 1, 0, "みやこ", 3, 0, 450, 1, 119901, 1, 119901, 119901, 14, 302, "2024/12/22 12:00:00", "ミヤコ（クリスマス）", 0, 0, 119901, "【物理】中衛で、味方をプリンで強化する幽霊聖少女。\n物理攻撃力と物理クリティカルアップのプリンパワーの\nフィールドで自分のスキルも強化し、猛攻を繰り出す。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/03/15 14:59:59", 2.375, 0, 1, 0, "しずる", 3, 0, 450, 5, 120001, 5, 120001, 120001, 6, 190, "2025/03/10 12:00:00", "シズル（ノワール）", 0, 0, 120001, "【物理】前衛で猛攻から味方を守護する闇のお姉ちゃん。\nバトル開始時の行動不能無効スキルで周囲の味方を守り、\n範囲を束縛するスキルで敵を牽制し、戦況を一変する。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 0, "2030/12/31 15:00:00", 0.0, 0, 0, 0, "いお", 3, 0, 0, 7, 120101, 7, 0, 0, 0, 0, "2015/04/01 15:00:00", "イオ（ノワール）", 0, 0, 120101, "");
