INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2030/12/31 15:00:00", 0.0, 180801, 0, 0, "みそぎ", 3, 0, 0, 0, 120501, 0, 0, 0, 0, 465, "2015/04/01 15:00:00", "ミソギ（リトルリリカル）", 0, 1, 120501, "");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2030/12/31 15:00:00", 0.0, 180801, 0, 0, "きょうか", 3, 0, 0, 0, 120601, 0, 0, 0, 0, 465, "2015/04/01 15:00:00", "キョウカ（リトルリリカル）", 0, 1, 120601, "");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/01/20 11:59:59", 1.84, 0, 1, 0, "しぇふぃ", 3, 0, 450, 22, 120701, 4, 120701, 120701, 1, 283, "2025/01/15 15:00:00", "シェフィ（ニューイヤー）", 0, 0, 120701, "【物理】前衛で、雪花舞う晴れ空をゆく新春氷竜少女。\nＵＢで顕現させる氷竜の牙で味方への強化スキルを高め\n自身の範囲攻撃技と共に苛烈な攻勢で敵陣を凍滅する。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2030/12/31 15:00:00", 1.3, 0, 1, 0, "るか", 1, 0, 450, 22, 120801, 4, 120801, 120801, 2, 193, "2023/10/16 15:00:00", "ルカ（ニューイヤー）", 0, 0, 120801, "【物理】前衛で雪月花の舞を納める新春の姉御。\n攻撃を当てる度に増加する【剣の刻印】でＵＢとスキルの\n威力を上昇させ、目にも止まらぬ斬撃で敵を圧倒する。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/01/20 11:59:59", 1.425, 0, 2, 0, "いりや", 3, 0, 450, 38, 120901, 3, 120901, 120901, 12, 424, "2025/01/15 15:00:00", "イリヤ（ニューイヤー）", 0, 0, 120901, "【魔法】中衛で自らの血を代償に力を振るう新春吸血鬼。\n自身のＨＰを消費して放つ強力なスキルと、敵からＴＰを\n吸収するスキルを自在に操り、目の前の敵を撃滅する。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/02/24 11:59:59", 2.25, 0, 1, 0, "ぺこりーぬ", 3, 0, 450, 41, 121001, 5, 121001, 121001, 1, 164, "2025/02/20 12:00:00", "ペコリーヌ（オーバーロード）", 0, 0, 121001, "【物理】前衛で、仲間との絆を力に変え戦う腹ペコ王女。\n敵のＨＰ状態で永続の物理攻撃力上昇と、短時間の特大\n攻撃力上昇＆自己ＴＰ回復を使い分け戦況を一変させる。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/02/24 11:59:59", 2.07, 0, 2, 0, "きゃる", 3, 0, 450, 42, 121101, 7, 121101, 121101, 1, 588, "2025/02/20 12:00:00", "キャル（オーバーロード）", 0, 0, 121101, "【魔法】中衛で仲間との絆を力に変え戦うツンデレ猫娘。\n敵を妨害するスキルと、ＵＢで敵全体を恐慌状態にし既に\n恐慌状態の敵のＴＰをダウンさせ、全戦場を掌握する。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2030/12/31 15:00:00", 1.55, 0, 1, 0, "らびりすた", 1, 0, 450, 40, 121201, 4, 121201, 121201, 6, 260, "2023/11/16 15:00:00", "ラビリスタ（オーバーロード）", 0, 0, 121201, "【物理】前衛で世界の理をすべて見つめる『迷宮女王』。\n味方を攻撃面で強化し、継続ＨＰ回復を全体に付与する\nスキルで戦線を整え、自身も圧倒的な力で敵を殲滅する。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 0, "2030/12/31 15:00:00", 1.9, 0, 1, 0, "くるみ", 3, 0, 450, 3, 121301, 3, 121301, 121301, 3, 731, "2022/03/03 19:00:00", "クルミ（ステージ）", 0, 0, 121301, "【物理】後衛で、皆のため意を決し奮起する小さな女優。\n残りＨＰが多いほど物理攻撃力がアップし、物理攻撃無効\nバリアのスキルやＨＰ・ＴＰ継続回復で味方を支援する。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 0, "2030/12/31 15:00:00", 2.27, 0, 2, 0, "みさき", 3, 0, 450, 7, 121401, 7, 121401, 121401, 15, 742, "2022/03/15 15:00:00", "ミサキ（ステージ）", 0, 0, 121401, "【魔法】後衛で後ろの味方を強化する魔法少女の看板娘。\n後衛の味方をバリアとＴＰ継続回復で支援し、自分の魔法\n攻撃力に応じ強化される攻撃力アップスキルで鼓舞する。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/04/30 11:59:59", 2.0, 0, 1, 0, "あゆみ", 3, 0, 450, 6, 121501, 6, 121501, 121501, 12, 590, "2025/04/26 12:00:00", "アユミ（怪盗）", 0, 0, 121501, "【物理】中衛で、闇夜に身を潜める神出鬼没の怪盗少女。\n敵の目の前から姿を消す隠密スキルや、遠くの敵に対する\nＴＰダウンスキルを駆使して、敵陣後方から瓦解させる。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 0, "2030/12/31 15:00:00", 1.425, 0, 1, 0, "いのり", 3, 0, 450, 3, 121601, 3, 121601, 121601, 17, 292, "2022/04/15 15:00:00", "イノリ（怪盗）", 0, 0, 121601, "【物理】前衛で闇に紛れ会心の一撃を放つ怪盗ドラゴン。\n隠密効果中、ダメージが大アップし必ずクリティカルする\nＵＢとスキルを駆使し安定したダメージを敵に叩き込む。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2030/12/31 15:00:00", 0.0, 180901, 0, 0, "あきの", 3, 0, 0, 0, 121701, 0, 0, 0, 0, 421, "2015/04/01 15:00:00", "アキノ（アキノ＆サレン）", 0, 1, 121701, "");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2030/12/31 15:00:00", 0.0, 180901, 0, 0, "されん", 3, 0, 0, 0, 121801, 0, 0, 0, 0, 421, "2015/04/01 15:00:00", "サレン（アキノ＆サレン）", 0, 1, 121801, "");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 0, "2030/12/31 15:00:00", 2.125, 0, 2, 0, "あんな", 3, 0, 450, 5, 121901, 5, 121901, 121901, 12, 293, "2022/05/15 15:00:00", "アンナ（パイレーツ）", 0, 0, 121901, "【魔法】前衛で己を鼓舞し高めた魔力を放つ蒼海の冥姫。\n発動の度、攻撃力とクリティカル時ダメージが上昇する\nＵＢと自己犠牲を払う強力な範囲攻撃技で敵を撃滅する。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 0, "2030/12/31 15:00:00", 1.425, 0, 1, 0, "しのぶ", 3, 0, 450, 3, 122001, 3, 122001, 122001, 14, 380, "2022/05/03 19:00:00", "シノブ（パイレーツ）", 0, 0, 122001, "【物理】中衛で、彷徨える魂を解き放つ海星の霊能少女。\n攻撃の際、付与する【霊錨の刻印】を駆使し、ダメージ量\nアップのスキルと防御力ダウンのＵＢで敵を浄滅へ導く。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2030/12/31 15:00:00", 1.97, 0, 1, 0, "あおい", 1, 0, 450, 35, 122101, 35, 122101, 122101, 9, 731, "2024/04/18 15:00:00", "アオイ（キャンプ）", 0, 0, 122101, "【物理】後衛で百千の矢を放つ、ぼっちの山籠りエルフ。\n物理魔法無効バリアで耐え凌ぎ、敵全体への射撃と自分の\n間合いに入った敵への強力な弓雨の追撃で掃討する。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 0, "2030/12/31 15:00:00", 1.84, 0, 1, 0, "ゆかり", 3, 0, 450, 4, 122201, 4, 122201, 122201, 8, 419, "2022/05/31 12:00:00", "ユカリ（キャンプ）", 0, 0, 122201, "【物理】中衛で最高の一杯を自然と共に愉しむ元聖騎士。\n【至福のひと時】が増えるほどに、味方の物理攻撃力や\nクリティカル時のダメージを強力に強化し、勝利を掴む。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 0, "2030/12/31 15:00:00", 1.425, 0, 2, 0, "うぁんぴぃ", 3, 0, 450, 43, 122301, 43, 122301, 122301, 0, 564, "2022/06/15 15:00:00", "ヴァンピィ", 0, 0, 122301, "【魔法】中衛で、幼き竜と共に歩むさいきょーの吸血姫。\n味方全体の強化と、敵のＴＰを吸収するスキルで力を蓄え\nＵＢ発動後ベスと共闘し防御ダウンと強撃で攻勢に出る。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2030/12/31 15:00:00", 2.42, 0, 1, 0, "ひより", 1, 0, 450, 1, 122401, 1, 122401, 122401, 8, 264, "2024/06/17 15:00:00", "ヒヨリ（サマー）", 0, 0, 122401, "【物理】前衛で皆にエールを送り鼓舞する真夏の元気娘。\n味方のＨＰを継続回復し行動速度アップの他、味方の数に\n応じてクリティカル強化と攻撃力を引き上げ勝利に導く。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2024/08/31 11:59:59", 1.965, 0, 1, 0, "れい", 3, 0, 450, 4, 122501, 4, 122501, 122501, 0, 250, "2024/08/26 19:00:00", "レイ（サマー）", 0, 0, 122501, "【物理】前衛で水刃の加護を纏い水面を駆ける渚の剣士。\nクリティカル時のダメージを底上げしＵＢ発動の度、纏う\n【水刃の加護】で全スキルダメージを上げ、敵陣を穿つ。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 0, "2030/12/31 15:00:00", 2.27, 0, 2, 0, "ゆい", 3, 0, 450, 7, 122601, 7, 122601, 122601, 0, 554, "2022/07/15 15:00:00", "ユイ（サマー）", 0, 0, 122601, "【魔法】中衛で、魔法キャラを補助する夜凪の魔法士。\n累積する攻撃強化スキルとＴＰ回復、物魔両面の無効\nバリアや継続ＨＰ回復で攻守共に味方を支え勝利へ導く。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 0, "2030/12/31 15:00:00", 1.92, 0, 2, 0, "きょうか", 3, 0, 450, 7, 122701, 7, 122701, 122701, 0, 812, "2022/08/15 15:00:00", "キョウカ（サマー）", 0, 0, 122701, "【魔法】後衛で、難しい魔法の練習に励む海辺の優等生。\nランダムな敵に当たるスキルの威力は攻撃の際に付与する\n【バタフライシール】で増幅し、防御力もダウンさせる。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2030/12/31 15:00:00", 2.295, 0, 1, 0, "みそぎ", 1, 0, 450, 1, 122801, 1, 122801, 122801, 0, 237, "2024/07/16 15:00:00", "ミソギ（サマー）", 0, 0, 122801, "【物理】前衛で敵後方に花火を仕掛ける夜涼みの悪戯娘。\n敵の最前衛をスタンで足止めしつつ、最後衛を中心とした\nＵＢで狭範囲の敵を引き寄せ、ＴＰダウンで攻勢を阻む。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2024/08/31 11:59:59", 2.25, 0, 1, 0, "みみ", 3, 0, 450, 5, 122901, 5, 122901, 122901, 0, 361, "2024/08/26 19:00:00", "ミミ（サマー）", 0, 0, 122901, "【物理】中衛で巨大バルーンと跳ね回る夏色うさぎっこ。\nＵＢやスキルで全てのマルチターゲットに追加ダメージを\n与え、自己強化と防御力ダウンで強敵のブレイクを狙う。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/05/03 18:59:59", 2.27, 0, 2, 0, "あめす", 3, 0, 450, 44, 123001, 44, 123001, 123001, 0, 746, "2025/04/30 12:00:00", "アメス", 0, 0, 123001, "【魔法】後衛で、新たな姿で騎士の冒険を支える妖精。\nダメージカットや防御力アップ、無効バリアで味方を護り\nバリアを起点とする攻撃力とＴＰの支援で攻勢に転ずる。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 0, "2030/12/31 15:00:00", 1.795, 0, 2, 0, "まほ", 3, 0, 450, 7, 123101, 7, 123101, 123101, 0, 793, "2022/09/03 19:00:00", "マホ（エクスプローラー）", 0, 0, 123101, "【魔法】後衛でぬいぐるみ達と大冒険に挑むマホ隊員。\n味方に付与する【ふわふわウール】は被ダメージ時に消費\nされＴＰを回復し、一気呵成の反撃で活路を切り拓く。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 0, "2030/12/31 15:00:00", 1.425, 0, 1, 0, "あやね", 3, 0, 450, 3, 123201, 3, 123201, 123201, 0, 256, "2022/09/15 15:00:00", "アヤネ（エクスプローラー）", 0, 0, 123201, "【物理】前衛で、相棒と困難を越え猛進するアヤネ隊員。\n群る敵を二つの範囲攻撃で一気に捉え、周囲の味方の物理\n攻撃力とクリティカルアップで冒険を阻む壁を打ち崩す。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2024/09/30 11:59:59", 1.62, 0, 1, 0, "ねあ", 3, 0, 450, 0, 123301, 1, 123301, 123301, 0, 350, "2024/09/25 12:00:00", "ネア", 0, 0, 123301, "【物理】中衛で粘液を振りまくキイロいスライムギャル。\nスキルで敵全体の物理攻撃能力やＴＰ上昇を低下させ、\nＵＢでスライム化し全敵を攻撃しつつ無敵ボディを得る。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 0, "2030/12/31 15:00:00", 0.0, 0, 0, 0, "じゅん", 3, 0, 0, 5, 123401, 5, 0, 0, 0, 0, "2015/04/01 15:00:00", "ジュン（キャンプ）", 0, 0, 123401, "");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2030/12/31 15:00:00", 2.34, 0, 1, 0, "りん", 1, 0, 450, 6, 123501, 6, 123501, 123501, 0, 583, "2024/09/17 15:00:00", "リン（ハロウィン）", 0, 0, 123501, "【物理】中衛で敵を悪戯で翻弄する恐怖のキョンシー娘。\n最も魔法攻撃力が高い敵に急襲を仕掛け、ＴＰ減少や魔法\n攻撃力ダウン、スタン等の妨害スキルで機先を制する。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2024/10/28 11:59:59", 1.965, 0, 1, 0, "とも", 3, 0, 450, 4, 123601, 4, 123601, 123601, 0, 262, "2024/10/24 12:00:00", "トモ（ハロウィン）", 0, 0, 123601, "【物理】前衛で、同志と力を合わせ共に戦う夜廻り剣士。\n自分と物理攻撃力が最も高い味方１キャラの攻撃力を大幅\nに上昇させ、目にもとまらぬ剣技で不届き者を成敗する。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 0, "2030/12/31 15:00:00", 2.07, 0, 2, 0, "ななか", 3, 0, 450, 21, 123701, 7, 123701, 123701, 0, 741, "2022/10/15 15:00:00", "ナナカ（ハロウィン）", 0, 0, 123701, "【魔法】後衛で、オタ活に精を出すハロウィン魔法少女。\nＨＰ回復量ダウンで敵の戦略を崩し、ダメージフィールド\nと対象の数で火傷の威力を増す熱狂の炎が敵を包み込む。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2024/11/30 11:59:59", 2.295, 0, 1, 0, "くりすてぃーな", 3, 0, 450, 1, 123801, 1, 123801, 123801, 0, 238, "2024/11/26 12:00:00", "クリスティーナ（ワイルド）", 0, 0, 123801, "【物理】前衛で、戦場を跳ね回るラビット姿の誓約女君。\n物理攻撃を全て回避するスキルと攻撃力の強化で敵陣に\n単身特攻をかけ、ＵＢの範囲攻撃で敵を内から薙ぎ倒す。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 0, "2030/12/31 15:00:00", 2.125, 0, 1, 0, "まつり", 3, 0, 450, 2, 123901, 2, 123901, 123901, 0, 183, "2022/11/15 15:00:00", "マツリ（ワイルド）", 0, 0, 123901, "【物理】前衛で母製の鎧を纏い気合い上々の獣人族騎士。\n自分のＨＰが低いほど与えるダメージと無効バリアの耐久\n力を高め、防御力ダウンと永続攻撃アップで活路を拓く。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2024/12/31 11:59:59", 2.07, 0, 2, 0, "あかり", 3, 0, 450, 7, 124001, 7, 124001, 124001, 0, 438, "2024/12/22 12:00:00", "アカリ（クリスマス）", 0, 0, 124001, "【魔法】中衛で、聖夜の街に幸せを運ぶ双子の妹サンタ。\n自分の魔法攻撃力に応じて効果が上がる味方全体への攻撃\n力強化に加え、単体特大魔法攻撃で勝利の旋律を奏でる。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2030/12/31 15:00:00", 1.965, 0, 2, 0, "より", 1, 0, 450, 6, 124101, 6, 124101, 124101, 0, 433, "2024/11/16 15:00:00", "ヨリ（クリスマス）", 0, 0, 124101, "【魔法】中衛で、光を灯し幸せを届ける双子の姉サンタ。\n最も近い１キャラの魔法攻撃力や行動速度アップ、ＴＰの\n回復に加え、全員を支援するスキルで聖夜の勝利を飾る。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 0, "2030/12/31 15:00:00", 2.07, 0, 1, 0, "じゅん", 3, 0, 450, 5, 124201, 5, 124201, 124201, 0, 144, "2022/12/23 12:00:00", "ジュン（クリスマス）", 0, 0, 124201, "【物理】前衛で、味方を庇護し祝福する聖白の騎士団長。\nスキルで後方の味方の攻撃能力を強化、ＴＰを回復させ、\n防御力ダウンと自分のＨＰを回復するＵＢで勝機を掴む。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2030/12/31 15:00:00", 0.0, 181001, 0, 0, "あん", 3, 0, 0, 0, 124301, 0, 0, 0, 0, 577, "2015/04/01 15:00:00", "アン（アン＆グレア）", 0, 1, 124301, "");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2030/12/31 15:00:00", 0.0, 181001, 0, 0, "ぐれあ", 3, 0, 0, 0, 124401, 0, 0, 0, 0, 577, "2015/04/01 15:00:00", "グレア（アン＆グレア）", 0, 1, 124401, "");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/01/20 11:59:59", 2.07, 0, 2, 0, "ほまれ", 3, 0, 450, 21, 124501, 7, 124501, 124501, 0, 707, "2025/01/15 15:00:00", "ホマレ（ニューイヤー）", 0, 0, 124501, "【魔法】後衛で、魔力を笑顔に隠す晴れ着姿の龍の首魁。\n自分の攻撃強化とＴＰ回復をし、ＵＢで放つ曙光の落涙は\n敵数で威力と防御力の減少量を上げ、全ての災厄を祓う。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/01/20 11:59:59", 2.44, 0, 2, 0, "みさと", 3, 0, 450, 21, 124601, 7, 124601, 124601, 0, 698, "2025/01/15 15:00:00", "ミサト（ニューイヤー）", 0, 0, 124601, "【魔法】後衛で真心重ねて味方をもてなす仲居姿の先生。\n全スキルで味方の物理攻撃力とクリティカル能力を上げ、\n魔防やＴＰ上昇の支援とＨＰ、ＴＰの回復で万福を願う。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2030/12/31 15:00:00", 2.24, 0, 1, 0, "みつき", 1, 0, 450, 46, 124701, 7, 124701, 124701, 0, 590, "2024/12/16 15:00:00", "ミツキ（ニューイヤー）", 0, 0, 124701, "【物理】中衛で、振袖姿で旅館に手を貸す隻眼の闇医者。\n朧ろ状態にした敵への攻撃時、スキルのダメージや防御力\nのダウン値が上昇し、紫煙に捉えた敵を艶然と討ち取る。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/02/24 11:59:59", 2.14, 0, 1, 0, "のぞみ", 3, 0, 450, 0, 124801, 4, 124801, 124801, 0, 423, "2025/02/20 12:00:00", "ノゾミ（リベレイター）", 0, 0, 124801, "【物理】中衛で、未来を信じ希望を灯すトップアイドル。\nバトル開始時に物理キャラのＴＰ特大回復と敵の永続物防\nダウンで加勢し、物理攻撃強化とＴＰ回復で勝利へ導く。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2030/12/31 15:00:00", 1.965, 0, 1, 0, "かや", 1, 0, 450, 0, 124901, 1, 124901, 124901, 0, 170, "2025/01/16 15:00:00", "カヤ（リベレイター）", 0, 0, 124901, "【物理】前衛で先陣を切り未来を掴む喧嘩屋ドラゴン族。\n初弾が大幅強化するスキルで自分の攻撃力とＴＰを大きく\n高め、威力を増したＵＢで先制し群がる敵を薙ぎ払う。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/02/24 11:59:59", 1.965, 0, 1, 0, "むいみ", 3, 0, 450, 0, 125001, 5, 125001, 125001, 0, 221, "2025/02/20 12:00:00", "ムイミ（リベレイター）", 0, 0, 125001, "【物理】前衛で、相棒と共に明日へと進む大悪党の少女。\n自己強化や物防ダウンを駆使するムイミと、ＵＢ後に一定\n時間共闘するオクトーの追撃で、輝く未来を取り戻す。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 0, "2030/12/31 15:00:00", 2.24, 0, 1, 0, "たまき", 3, 0, 450, 47, 125101, 8, 125101, 125101, 0, 825, "2023/03/03 19:00:00", "タマキ（カフェ）", 0, 0, 125101, "【物理】後衛から客を癒しもてなす猫カフェ店員の猫娘。\n物攻の高いキャラの傍で周囲の物攻アップやＨＰとＴＰを\n回復し、周囲の味方数で強化される攻撃で敵を一掃する。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 0, "2030/12/31 15:00:00", 1.965, 0, 1, 0, "もにか", 3, 0, 450, 4, 125201, 4, 125201, 125201, 0, 463, "2023/03/10 12:00:00", "モニカ（カフェ）", 0, 0, 125201, "【物理】中衛で、駄菓子を振舞い福を蒔く猫カフェ店員。\n攻撃を３回受けるまで味方全体の物理攻撃力を極大アップ\nさせ、２種の物防ダウンスキルで序盤を一気に加勢する。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/04/30 11:59:59", 2.07, 0, 1, 0, "こっころ", 3, 0, 450, 6, 125301, 6, 125301, 125301, 0, 752, "2025/04/26 12:00:00", "コッコロ（レンジャー）", 0, 0, 125301, "【物理】後衛で、わんわんと一緒の新緑レンジャー少女。\n自分の攻撃力に応じて強化される物理攻撃支援スキルや\nＨＰ継続回復、バリアで周囲を支え、絆の勝利へと導く。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 0, "2030/12/31 15:00:00", 2.09, 0, 1, 0, "しおり", 3, 0, 450, 8, 125401, 8, 125401, 125401, 0, 710, "2023/04/10 12:00:00", "シオリ（レンジャー）", 0, 0, 125401, "【物理】後衛で、相棒と共に山を駆ける新米レンジャー。\nスキルで自分の攻撃力とクリティカル時のダメージを上げ\nＴＰを回復し、ダメージと防御力ダウンで敵を追い込む。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2024/05/15 14:59:59", 1.92, 0, 2, 0, "じーた", 3, 0, 450, 50, 125501, 7, 125501, 125501, 0, 443, "2024/05/10 12:00:00", "ジータ（ウォーロック）", 0, 0, 125501, "【魔法】中衛で、他の術者と魔力を束ねる究竟の魔導士。\n味方への魔法攻撃支援とＴＰ回復に加え、敵陣の攻防両面\nの弱体化で戦況を整え、自らも強力な攻撃魔法を放つ。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2024/05/15 14:59:59", 2.09, 0, 1, 0, "びから", 3, 0, 450, 0, 125601, 51, 125601, 125601, 0, 267, "2024/05/10 12:00:00", "ビカラ", 0, 0, 125601, "【物理】前衛で夢と希望とネズ耳を届ける鼠神宮の巫女。\n周囲の味方の物理攻撃支援、ＴＰ上昇アップと回復で援護\nし、自身の無敵化で敵の隙を突き鋭い金牙の一撃を放つ。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2030/12/31 15:00:00", 2.24, 0, 2, 0, "かりん", 1, 0, 450, 9, 125701, 7, 125701, 125701, 0, 579, "2025/04/16 15:00:00", "カリン（アルケミスト）", 0, 0, 125701, "【魔法】中衛で森羅万象を究め味方を支援する錬金術師。\n物理、魔法の属性を問わない敵の弱体化と味方の強化に加\nえ、スキルによる高頻度のＨＰ回復で盤石な戦局を築く。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 0, "2030/12/31 15:00:00", 2.09, 0, 1, 0, "りり", 3, 0, 450, 0, 125801, 3, 125801, 125801, 0, 464, "2023/04/17 12:00:00", "リリ（フォールン）", 0, 0, 125801, "【物理】中衛で、黒羽の力を使い空を制する嘆鎌の少女。\nバトル開始時に、敵の範囲攻撃を躱す【飛行】状態となり\n生成したシャドウと共に、眼前の敵を一薙ぎに斬り払う。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2030/12/31 15:00:00", 0.0, 0, 0, 0, "かや", 3, 0, 0, 1, 125901, 1, 0, 0, 0, 0, "2015/04/01 15:00:00", "カヤ（リベレイター）", 0, 0, 125901, "");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 0, "2030/12/31 15:00:00", 2.09, 0, 1, 0, "くりあ", 3, 0, 450, 0, 126001, 0, 126001, 126001, 0, 406, "2023/10/31 12:00:00", "クリア（フォールン）", 0, 0, 126001, "【物理】中衛から、我が身を盾に味方を守る隠棘の少女。\nバトル開始時【飛行】し、最もＨＰの低い味方をかばい、\n味方のＨＰに応じて強化されるスキルで敵を牽制する。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 0, "2030/12/31 15:00:00", 2.09, 0, 2, 0, "ぷれしあ", 3, 0, 450, 53, 126101, 44, 126101, 126101, 0, 480, "2023/11/15 15:00:00", "プレシア（フォールン）", 0, 0, 126101, "【魔法】中衛で、マイペースに味方を支える破杖の少女。\n【飛行】し、クリティカルの強化やＨＰ・ＴＰ回復で味方\nを支援し、魔法攻撃力を加えた物理攻撃で敵を平らげる。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2024/06/15 14:59:59", 2.09, 0, 2, 0, "いりや", 3, 0, 450, 3, 126201, 3, 126201, 126201, 0, 568, "2024/06/10 12:00:00", "イリヤ（儀装束）", 0, 0, 126201, "【魔法】中衛で、眷属と永久の血盟を誓う月下の吸血鬼。\nＵＢで眷属を２体喚び、味方への攻撃支援や行動速度上昇\nで強化し、眷属と共に見舞う猛攻で前途を阻む敵を討つ。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 0, "2030/12/31 15:00:00", 2.07, 0, 2, 0, "ゆき", 3, 0, 450, 9, 126301, 7, 126301, 126301, 0, 456, "2023/06/15 15:00:00", "ユキ（儀装束）", 0, 0, 126301, "【魔法】中衛で、闇色の儀装束を纏う「美を統べる者」。\nステータスアップ効果を受け【美貌】を増し、魔法攻撃力\nダウンや味方の強化、ＴＰ回復の効果を高めて解き放つ。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/05/03 18:59:59", 2.09, 0, 1, 0, "くろーちぇ", 3, 0, 450, 1, 126401, 1, 126401, 126401, 0, 373, "2025/04/30 12:00:00", "クローチェ", 0, 0, 126401, "【物理】中衛で着脱可能な鉄腕を放つ機械人族のロボ娘。\nＵＢ発動で【フルチャージ】状態になり、【バッテリー】\nが切れるまで強化スキルを連発し、一帯を超速圧砕する。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/05/03 18:59:59", 1.965, 0, 2, 0, "らいらえる", 3, 0, 450, 0, 126501, 7, 126501, 126501, 0, 740, "2025/04/30 12:00:00", "ライラエル", 0, 0, 126501, "【魔法】後衛で優美にほほ笑むジオ・テオゴニアの姫君。\n開始時に発動する【界雷】で、敵味方に影響を与えつつ、\n魔法防御ダウンと強力なダメージスキルで裁きを下す。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2024/07/15 14:59:59", 2.04, 0, 2, 0, "ねねか", 3, 0, 450, 7, 126601, 7, 126601, 126601, 0, 650, "2024/07/11 12:00:00", "ネネカ（サマー）", 0, 0, 126601, "【魔法】後衛で、涼しげに微笑む夏色姿の『変貌大妃』。\nスキルで味方を大幅に強化し、最も魔法攻撃力が高い味方\nの魔法攻撃力を写し取った攻撃力で、強力なＵＢを放つ。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2030/12/31 15:00:00", 1.965, 0, 1, 0, "あきの", 1, 0, 450, 5, 126701, 5, 126701, 126701, 0, 224, "2023/06/30 12:00:00", "アキノ（サマー）", 0, 1, 126701, "【物理】前衛で、優雅なバカンスを過ごす夕映えの令嬢。\n敵が魔法攻撃をする場合に効果を大幅に上げる２種の範囲\n攻撃と攻防両面の支援スキルで、盛夏の勝鬨を上げる。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 0, "2030/12/31 15:00:00", 1.97, 0, 1, 0, "ゆかり", 3, 0, 450, 5, 126801, 5, 126801, 126801, 0, 159, "2023/07/15 15:00:00", "ユカリ（サマー）", 0, 0, 126801, "【物理】前衛で、夏の麦しゅわを嗜むビーチの元聖騎士。\n敵単体にダメージを与えながら、周囲の味方への魔法無効\nバリア付与と魔防アップで守りを固めて勝利の波に乗る。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2024/08/12 11:59:59", 1.965, 0, 2, 0, "らんふぁ", 3, 0, 450, 21, 126901, 7, 126901, 126901, 0, 682, "2024/08/09 12:00:00", "ランファ（サマー）", 0, 0, 126901, "【魔法】後衛で、密やかな潮騒に耳を傾ける晩陽の歌姫。\n魔法クリティカルの極大アップを筆頭に攻防両面で周囲の\n味方を強化し、さらに自身もＵＢで数多の敵を退かせる。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2023/08/14 20:59:59", 1.97, 0, 1, 0, "くうか", 1, 0, 450, 52, 127001, 2, 127001, 127001, 0, 133, "2023/07/31 12:00:00", "クウカ（サマー）", 0, 1, 127001, "【物理】前衛で新たな刺激を追い求める水着姿のドＭ娘。\n自分のＨＰが下がるほど効果量が上昇するスキルの物理攻\n撃力アップとＵＢのダメージで、勝利の大海へ飛び込む。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2024/08/12 11:59:59", 2.09, 0, 1, 0, "しのぶ", 3, 0, 450, 46, 127101, 5, 127101, 127101, 0, 255, "2024/08/09 12:00:00", "シノブ（サマー）", 0, 0, 127101, "【物理】前衛で、穏やかな水面に揺蕩う夜光の霊能少女。\n召喚した親父に敵の攻撃を引き付けさせつつ、シノブ自身\nの攻撃性能強化と防御ダウンを扱い、敵を冥海へと誘う。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2024/10/13 11:59:59", 2.09, 0, 2, 0, "きゃる", 3, 0, 450, 7, 127201, 7, 127201, 127201, 0, 804, "2024/10/10 12:00:00", "キャル（編入生）", 0, 0, 127201, "【魔法】後衛で、制服姿に胸を高鳴らせるアオハル猫娘。\n攻防両面のサポートに加え行動速度アップとＴＰ回復で味\n方を支援し、最も遠くの敵を狙うＵＢで輝く勝利を得る。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 0, "2030/12/31 15:00:00", 2.09, 0, 1, 0, "すずな", 3, 0, 450, 8, 127301, 8, 127301, 127301, 0, 750, "2023/09/15 15:00:00", "スズナ（編入生）", 0, 0, 127301, "【物理】後衛でもにカワ制服を着こなすカリスマモデル。\nクリティカル時に味方を強化するスキルや、追加ダメージ\nが発生するＵＢによって青春の一ページを切り取る。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2030/12/31 15:00:00", 0.0, 0, 0, 0, "びから", 3, 0, 0, 1, 127401, 1, 0, 0, 0, 0, "2015/04/01 15:00:00", "ビカラ（コラボ）", 0, 0, 127401, "");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2024/11/18 11:59:59", 2.09, 0, 1, 0, "されん", 3, 0, 450, 4, 127501, 4, 127501, 127501, 0, 304, "2024/11/11 12:00:00", "サレン（サラサリア）", 0, 0, 127501, "【物理】中衛で、優艶に炎と踊り舞う情熱のサレンママ。\n物理攻撃から味方を守り、【炎舞の刻印】の数に応じて効\n果の上がる物攻アップとＴＰ回復で皆を奮い立たせる。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 0, "2030/12/31 15:00:00", 1.965, 0, 1, 0, "るか", 3, 0, 450, 4, 127601, 4, 127601, 127601, 0, 157, "2023/10/15 15:00:00", "ルカ（サラサリア）", 0, 0, 127601, "【物理】前衛で、空飛ぶ絨毯で巡り回るオアシスの姉御。\n自分の物防を大幅に高めて敵を挑発するスキルと敵のＴＰ\nとＴＰ上昇をダウンさせるＵＢで、爽やかに勝利を掴む。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 0, "2030/12/31 15:00:00", 1.965, 0, 2, 0, "りんど", 3, 0, 450, 48, 127701, 6, 127701, 127701, 0, 693, "2024/10/10 12:00:00", "リンド", 0, 0, 127701, "【魔法】後衛で、メイド業に奔走する双子ドラゴンの姉。\nＵＢのフィールド展開中は攻撃、防御、ＴＰ回復と多彩な\n支援スキルの効果が再発動し味方を手厚くサポートする。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 0, "2030/12/31 15:00:00", 1.965, 0, 2, 0, "うるむ", 3, 0, 450, 47, 127801, 7, 127801, 127801, 0, 706, "2024/10/18 12:00:00", "ヴルム", 0, 0, 127801, "【魔法】後衛で、文句を言いつつ働く双子ドラゴンの妹。\nダメージと魔法防御力ダウンを両立するスキルを持つが、\n目を離すと【サボりの誘惑】に負け、手を抜いてしまう。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2024/12/15 14:59:59", 1.965, 0, 2, 0, "ぺこりーぬ", 3, 0, 450, 5, 127901, 5, 127901, 127901, 0, 372, "2024/12/09 12:00:00", "ペコリーヌ（クリスマス）", 0, 0, 127901, "【魔法】中衛でみんなに笑顔を届ける腹ペコサンタ王女。\n前線で敵の攻撃を耐えながら範囲内の味方の防御サポート\nと敵の防御ダウンまでこなし、聖夜に勝利の輝きを灯す。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 0, "2030/12/31 15:00:00", 2.09, 0, 1, 0, "くれじった", 3, 0, 450, 35, 128001, 35, 128001, 128001, 0, 723, "2023/12/15 15:00:00", "クレジッタ（クリスマス）", 0, 0, 128001, "【物理】後衛で、甘美なひと時を堪能する聖夜の女商人。\n最も遠い味方へのＴＰ回復や、初弾に追加効果のある攻撃\nで敵の弱体化と味方の強化を行い、勝利の舞台を整える。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2030/12/31 15:00:00", 0.0, 181101, 0, 0, "しずる", 3, 0, 0, 0, 128101, 0, 0, 0, 0, 580, "2015/04/01 15:00:00", "シズル（シズル&リノ）", 0, 1, 128101, "");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2030/12/31 15:00:00", 0.0, 181101, 0, 0, "りの", 3, 0, 0, 0, 128201, 0, 0, 0, 0, 580, "2015/04/01 15:00:00", "リノ（シズル&リノ）", 0, 1, 128201, "");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2030/12/31 15:00:00", 2.09, 0, 1, 0, "いのり", 1, 0, 450, 38, 128301, 3, 128301, 128301, 0, 191, "2023/12/31 12:00:00", "イノリ（ニューイヤー）", 0, 1, 128301, "【物理】前衛で相手をからかうお調子者の年神ドラゴン。\n敵全体を挑発し、敵の妨害スキルにカウンターして前方の\n敵すべてをスタンさせるスキルで戦局を引っ掻き回す。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/01/15 14:59:59", 2.09, 0, 2, 0, "はつね", 3, 0, 450, 21, 128401, 7, 128401, 128401, 0, 801, "2025/01/09 12:00:00", "ハツネ（ニューイヤー）", 0, 0, 128401, "【魔法】後衛で特別な景色を共にする初夢超能力ガール。\n敵が物理攻撃を行う場合、攻撃性能の強化に加えて複数の\n弱体効果が追加され、攻守ともに味方を支援し敵を掃う。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/01/15 14:59:59", 2.09, 0, 2, 0, "かすみ", 3, 0, 450, 21, 128501, 7, 128501, 128501, 0, 739, "2025/01/09 12:00:00", "カスミ（ニューイヤー）", 0, 0, 128501, "【魔法】後衛で、絵馬に秘めた願いを祷る新年の名探偵。\n敵と味方の数で効果量が上昇するダメージと攻撃力支援に\n加え、２種類の回復スキルを使いこなして勝利を願う。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2030/12/31 15:00:00", 0.0, 0, 0, 0, "りり", 3, 0, 0, 1, 128601, 1, 0, 0, 0, 0, "2015/04/01 15:00:00", "リリ（フォールン）", 0, 0, 128601, "");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/02/15 14:59:59", 2.09, 0, 1, 0, "ひより", 3, 0, 450, 0, 128701, 1, 128701, 128701, 0, 226, "2025/02/10 12:00:00", "ヒヨリ（アストラル）", 0, 0, 128701, "【物理】前衛で、煌炎宿し希望を振りまく覚醒の元気娘。\n放つ炎は敵を攻守ともに弱化させて同時に味方を鼓舞し、\n２種のＴＰ回復効果で攻勢を絶やさず勝利を呼び込む。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2030/12/31 15:00:00", 1.965, 0, 1, 0, "れい", 1, 0, 450, 0, 128801, 4, 128801, 128801, 0, 194, "2024/01/31 12:00:00", "レイ（アストラル）", 0, 1, 128801, "【物理】前衛で、旋風を纏い未来へ駆ける覚醒の剣士。\n目にも止まらぬ速さの剣技で敵を吹き飛ばしスタンさせ、\n仲間の守りを固めるスキルを駆使し勝利の道を切り開く。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/02/15 14:59:59", 2.09, 0, 2, 0, "ゆい", 3, 0, 450, 0, 128901, 7, 128901, 128901, 0, 772, "2025/02/10 12:00:00", "ユイ（アストラル）", 0, 0, 128901, "【魔法】後衛で、願いを力に極光を放つ覚醒の魔法士。\n自分を強化しながら高火力魔法を絶えず撃ち込み、バリア\nを起点とした味方への攻撃支援スキルで勝利を手にする。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/05/03 18:59:59", 2.09, 0, 2, 0, "えりす", 3, 0, 450, 0, 129001, 7, 129001, 129001, 0, 800, "2025/04/30 12:00:00", "エリス", 0, 0, 129001, "【魔法】後衛で、眠りから目覚め美しく咲き誇る黒薔薇。\n終焉を超えし【回帰の薔薇】と、行動速度アップを始めと\nした多種の攻防支援で味方を強化し、新たな未来を掴む。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/03/15 14:59:59", 2.09, 0, 1, 0, "ゆに", 3, 0, 450, 7, 129301, 7, 129301, 129301, 0, 708, "2025/03/10 12:00:00", "ユニ（ウィンター）", 0, 0, 129301, "【物理】後衛で、退廃的な冬の学びに溺れる水際の才媛。\n物理攻撃の強化、回復、行動速度アップで味方を支援し、\nＵＢで得た【水際の安寧】を死守するため膂力を振るう。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 0, "2030/12/31 15:00:00", 2.09, 0, 1, 0, "くろえ", 3, 0, 450, 2, 129401, 2, 129401, 129401, 0, 188, "2024/03/18 12:00:00", "クロエ（ウィンター）", 0, 0, 129401, "【物理】前衛で、水面に映る神速のダウナー系水着女子。\n攻撃を当てる度に敵に付与する【水月】の数に応じて物防\nダウンやダメージの効果が上昇し、必勝の抜き手を切る。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2024/12/22 11:59:59", 2.09, 0, 1, 0, "ちえる", 3, 0, 450, 1, 129501, 1, 129501, 129501, 0, 247, "2024/12/15 15:00:00", "チエル（ウィンター）", 0, 0, 129501, "【物理】前衛で、ちぇるっとちぇるるな水着のちえるん。\nステータスアップで溜まる【ちぇる】を、自身の火力や\n支援能力に還元して、真冬の真夏をちぇらるれれぽぱぴ？");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/05/03 18:59:59", 2.09, 0, 1, 0, "あねもね", 3, 0, 450, 0, 129601, 0, 129601, 129601, 0, 550, "2025/04/30 12:00:00", "アネモネ", 0, 0, 129601, "【物理】中衛で怜悧麗花の陣を張るアルラウネの妖魔人。\n敵の攻撃力、防御力、与ダメージを下げ、ＴＰを吸収し、\nＵＢの継続ダメージで領域を侵す敵を絶えず拒み退ける。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/05/03 18:59:59", 2.09, 0, 1, 0, "ねふぃーねら", 3, 0, 450, 0, 129701, 0, 129701, 129701, 0, 540, "2025/04/30 12:00:00", "ネフィ＝ネラ", 0, 0, 129701, "【物理】中衛で万魔の頂点に君臨するジオ・ゲヘナの媛。\n環境効果【妨魔塵】で魔法攻撃を阻害し、行動速度アップ\n等の支援や苛烈な攻撃で無謀な不届き者を平伏させる。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/04/30 11:59:59", 2.09, 0, 1, 0, "まこと", 3, 0, 450, 5, 129801, 5, 129801, 129801, 0, 269, "2025/04/26 12:00:00", "マコト（コマンダー）", 0, 0, 129801, "【物理】前衛で、情と熱意で仲間を束ねる指揮官の狼娘。\n敵の攻守を削りつつ、自分のＴＰ回復や対象が物防ダウン\n状態の時に発生する追撃で猛攻を仕掛け前線を突破する。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 0, "2030/12/31 15:00:00", 1.84, 0, 1, 0, "えりこ", 3, 0, 450, 48, 129901, 6, 129901, 129901, 0, 294, "2024/04/15 15:00:00", "エリコ（コマンダー）", 0, 0, 129901, "【物理】前衛で、苛烈な教えで味方を率いる狂恋の教官。\nＴＰ回復や防御支援に加え味方の人数で効果アップする攻\n撃支援と大ダメージで、味方全体を奮い立たせ敵を破る。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/05/15 14:59:59", 2.09, 0, 1, 0, "やまと", 3, 0, 450, 0, 130001, 4, 130001, 130001, 0, 150, "2025/05/03 19:00:00", "ヤマト", 0, 0, 130001, "【物理】前衛で、豪胆にスリルを嗜む盗賊ギルドの長女。\n最前線で命を張りながら、獲得した【バンディダイス】の\n消費によって自らを大幅強化し、有象無象を地に伏せる。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/05/15 14:59:59", 2.09, 0, 1, 0, "わかな", 3, 0, 450, 9, 130101, 7, 130101, 130101, 0, 535, "2025/05/03 19:00:00", "ワカナ", 0, 0, 130101, "【物理】中衛の、貧乏クジを引きがちな盗賊ギルド次女。\n召喚したスキッドがワカナをかばって前線に立ち、自身は\n攻撃支援にＨＰとＴＰ回復まで、献身的に味方を支える。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/05/15 14:59:59", 1.84, 0, 1, 0, "ふぶき", 3, 0, 450, 0, 130201, 5, 130201, 130201, 0, 371, "2025/05/03 19:00:00", "フブキ", 0, 0, 130201, "【物理】中衛の、ナマイキで超天才な盗賊ギルドの三女。\n【味方バリアー♡】で自分へのダメージを味方に押し付け\nＨＰ最大でダメージアップする範囲攻撃で敵を蹂躙する。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2030/12/31 15:00:00", 0.0, 0, 0, 0, "れい", 3, 0, 0, 1, 130601, 4, 0, 0, 0, 0, "2015/04/01 15:00:00", "レイ（アストラル）", 0, 0, 130601, "");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/05/15 14:59:59", 1.92, 0, 2, 0, "きょうか", 3, 0, 450, 7, 130701, 7, 130701, 130701, 0, 563, "2025/05/03 19:00:00", "キョウカ（スプリング）", 0, 0, 130701, "【魔法】中衛で、お花畑に春を届ける花衣装の優等生。\nスキル発動回数に応じた効率的な自己強化やクリティカル\n時の追加効果を持つスキルとＵＢで勝利の風を吹かせる。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 0, "2030/12/31 15:00:00", 1.84, 0, 2, 0, "すずめ", 3, 0, 450, 7, 130801, 7, 130801, 130801, 0, 558, "2024/05/15 15:00:00", "スズメ（スプリング）", 0, 0, 130801, "【魔法】中衛で、春に彩られた花衣装のドジっ娘メイド。\n範囲内の敵にダメージを与えながら、多数の弱体化効果を\n持つスキルやＵＢを駆使して、穏やかに吹く勝利を掴む。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 0, "2030/12/31 15:00:00", 2.09, 0, 2, 0, "くるる", 3, 0, 450, 7, 130901, 7, 130901, 130901, 0, 440, "2024/06/15 15:00:00", "クルル", 0, 0, 130901, "【魔法】中衛で、皆を夢の世界に誘う宝石兎族の支配人。\nステータスアップ効果を受けるたびに【かばばん君】を増\nやし、反射的に味方へ攻撃支援の恩返しをしてしまう。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2024/12/15 14:59:59", 1.84, 0, 2, 0, "まほ", 3, 0, 450, 7, 131001, 7, 131001, 131001, 0, 702, "2024/12/09 12:00:00", "マホ（ドリームパーク）", 0, 0, 131001, "【魔法】後衛で、サーカスの舞台に輝くメルヘン少女。\n味方の攻防支援や敵の攻防弱体化の他【カーテンコール】\n付与時の追加ダメージスキルで、勝利のライトを照らす。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 0, "2030/12/31 15:00:00", 2.09, 0, 1, 0, "ねあ", 3, 0, 450, 52, 131101, 2, 131101, 131101, 0, 165, "2024/06/30 12:00:00", "ネア（サマー）", 0, 0, 131101, "【物理】前衛でハグの機会を窺う水着のスライムギャル。\n攻撃してきた敵に【ネバネバ】を自動で付着させ、攻撃力\nダウンやダメージ、束縛など複数の効果を引き起こす。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/01/15 14:59:59", 2.09, 0, 2, 0, "みそら", 3, 0, 450, 35, 131201, 35, 131201, 131201, 0, 753, "2025/01/09 12:00:00", "ミソラ（サマー）", 0, 0, 131201, "【魔法】後衛で夏の盛りにイイコトをする溌溂水着少女★\n【PSI★ストーム】をチャージし、連続攻撃で敵を殲滅し\nて、継続ＴＰ回復やバリアで抜け目なく味方を支援する。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2030/12/31 15:00:00", 0.0, 0, 0, 0, "りり", 3, 0, 0, 1, 131301, 1, 0, 0, 0, 0, "2015/04/01 15:00:00", "リリ", 0, 1, 131301, "");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2030/12/31 15:00:00", 0.0, 0, 0, 0, "くりあ", 3, 0, 0, 1, 131401, 1, 0, 0, 0, 0, "2015/04/01 15:00:00", "クリア", 0, 1, 131401, "");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2030/12/31 15:00:00", 0.0, 0, 0, 0, "ぷれしあ", 3, 0, 0, 1, 131501, 1, 0, 0, 0, 0, "2015/04/01 15:00:00", "プレシア", 0, 1, 131501, "");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/01/15 14:59:59", 1.92, 0, 1, 0, "りり", 3, 0, 450, 4, 131601, 4, 131601, 131601, 0, 399, "2025/01/09 12:00:00", "リリ（サマー）", 0, 0, 131601, "【物理】中衛で、夏の陽光のもと研鑽する妹系大和撫子。\n防御力アップに加えバリアやＨＰ回復で味方の守りを固め\nＴＰ回復や攻撃力ダウンをも巧みに操り、場を支配する。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/02/15 14:59:59", 1.92, 0, 2, 0, "あめす", 3, 0, 450, 53, 131701, 44, 131701, 131701, 0, 743, "2025/02/10 12:00:00", "アメス（サマー）", 0, 0, 131701, "【魔法】後衛で、黄昏の水面に舞い降りる水着姿の妖精。\n行動速度アップやＴＰ支援をはじめとした多数のサポート\nを施しつつ、ＵＢの攻防弱体化で清爽に勝利へと導く。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 0, "2030/12/31 15:00:00", 2.09, 0, 2, 0, "ほまれ", 3, 0, 450, 21, 131801, 7, 131801, 131801, 0, 709, "2024/08/15 15:00:00", "ホマレ（サマー）", 0, 0, 131801, "【魔法】後衛で夏の清涼に翼を休める水着姿の龍の首領。\n攻防弱体化に加え、ステータスダウン付与のたび増加する\n【日食】の数に応じたダメージで、抗う全てを灰に帰す。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2030/12/31 15:00:00", 2.09, 0, 2, 0, "えみりあ", 1, 0, 450, 23, 131901, 7, 131901, 131901, 0, 725, "2024/08/31 12:00:00", "エミリア（サマー）", 0, 1, 131901, "【魔法】後衛で、パックと共に戦う真夏のハーフエルフ。\n氷壁を生成するスキルや、強力なダメージと速度ダウンを\n付与するユニオンバーストで、敵の侵攻を食い止める。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2024/09/25 11:59:59", 2.09, 0, 2, 0, "えきどな", 3, 0, 450, 21, 132001, 7, 132001, 132001, 0, 775, "2024/09/13 12:00:00", "エキドナ（サマー）", 0, 0, 132001, "【魔法】後衛で未知の世界との邂逅に胸躍る強欲の魔女。\n鮮烈な攻撃魔法をはじめ、味方への攻撃支援、敵の弱体化\nから自己蘇生まで、あらゆる魔法を振るい、欲を満たす。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2024/09/13 11:59:59", 2.09, 0, 1, 0, "れむ", 3, 0, 450, 24, 132101, 13, 132101, 132101, 0, 146, "2024/08/31 12:00:00", "レム（サマー）", 0, 0, 132101, "【物理】前衛で夏の日差しの中、余暇を楽しむ双子の妹。\nＵＢで鬼族の力を解放すると攻防両面に加えＨＰ吸収が\n上昇し、目に映る全てを【狂騒】のままに叩き伏せる。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/05/15 14:59:59", 1.84, 0, 2, 0, "のぞみ", 3, 0, 450, 7, 132201, 7, 132201, 132201, 0, 721, "2025/05/03 19:00:00", "ノゾミ（アルケミスト）", 0, 0, 132201, "【魔法】後衛で、希望を錬成するアルケミストアイドル。\n【錬金素材】から【パフューム】を創り、ダメージに加え\nＴＰ回復や攻撃支援能力を向上させて勝利の香りを運ぶ。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/05/15 14:59:59", 2.09, 0, 2, 0, "るいずまりー", 3, 0, 450, 7, 132301, 7, 132301, 132301, 0, 754, "2025/05/03 19:00:00", "ルイズマリー", 0, 0, 132301, "【魔法】後衛で、底知れぬ叡智を秘めた天才錬金術師。\n高い方の防御力でダメージを受ける調和状態を付与し、\n２回まで性能が上昇していくＵＢで、妄想を爆発させる。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2024/12/09 11:59:59", 2.09, 0, 2, 0, "らいらえる", 3, 0, 450, 0, 132801, 7, 132801, 132801, 0, 750, "2024/11/30 12:00:00", "ライラエル（クリスマス）", 0, 0, 132801, "【魔法】後衛で、雪白の肌を黒衣に包んだ甘美なる姫君。\n味方のＨＰを代償に強力なバリアを展開しつつ、バリアを\n起点とした高出力の二連撃で、聖夜の大樹に灯を点す。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 0, "2030/12/31 15:00:00", 2.09, 0, 2, 0, "いお", 3, 0, 450, 46, 132901, 5, 132901, 132901, 0, 748, "2024/12/09 12:00:00", "イオ（クリスマス）", 0, 0, 132901, "【魔法】後衛で、心地良い眠りの中に訪れる聖夜の悪魔。\n最も魔法攻撃力が高い味方に【悪魔の口づけ】を付与し、\n攻撃支援とＴＰ回復による付きっきりの手ほどきをする。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/05/03 18:59:59", 2.09, 0, 1, 0, "ぐれいす", 3, 0, 450, 0, 133001, 0, 133001, 133001, 0, 234, "2025/04/30 12:00:00", "グレイス", 0, 0, 133001, "【物理】前衛で、宙を舞うように戦う幽霊の守護騎士。\nＵＢで味方の攻撃と速度支援を行い、【レイスボディ】で\n敵の目を逃れ、不意を突く一撃で永遠の眠りにつかせる。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/05/03 18:59:59", 1.75, 0, 1, 0, "うぁいおれっと", 3, 0, 450, 0, 133101, 0, 133101, 133101, 0, 154, "2025/04/30 12:00:00", "ヴァイオレット", 0, 0, 133101, "【物理】前衛で、儚くも凛と咲くジオ・ニヴルヘルの姫。\n継続ダメージ効果を鈍化させる環境効果【忌火】で盾に、\n絶怠霊度の継続割合攻撃で矛となり、静寂の冥府を護る。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2030/12/31 15:00:00", 2.09, 0, 1, 0, "もにか", 1, 0, 450, 22, 133201, 4, 133201, 133201, 0, 296, "2024/12/31 12:00:00", "モニカ（ニューイヤー）", 0, 1, 133201, "【物理】前衛で、元日も元気にはしゃぎまわる軍人少女。\n与ダメージに応じて追加効果が強化されるＵＢと、発動ご\nとに成長する自己強化スキルで秩序を乱す者の目を回す。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/01/15 14:59:59", 2.09, 0, 2, 0, "されん", 3, 0, 450, 22, 133501, 4, 133501, 133501, 0, 718, "2025/01/03 19:00:00", "サレン（ニューイヤー）", 0, 0, 133501, "【魔法】後衛で、傍らで心を重ねる振袖姿の救護院の主。\n味方へのＴＰ回復の支援をしつつ、味方がＵＢを発動する\nたびダメージが上がるスキルで、共に困難を乗り越える。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/01/31 11:59:59", 2.09, 0, 1, 0, "めどぅーさ", 3, 0, 450, 0, 133601, 0, 133601, 133601, 0, 445, "2025/01/20 12:00:00", "メドゥーサ", 0, 0, 133601, "【物理】中衛で眷属と力を合わせて戦う誇り高き蛇乙女。\n【魔眼】の数に応じて効果量が上がるスキルのダメージと\n弱体化で範囲内の敵を追い詰め、鋭い瞳で石へと変える。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/02/10 11:59:59", 2.09, 0, 2, 0, "らびりすた", 3, 0, 450, 0, 133701, 8, 133701, 133701, 0, 717, "2025/01/31 12:00:00", "ラビリスタ（アルファ）", 0, 0, 133701, "【魔法】後衛で、始原の冠装を使いこなす『迷宮女王』。\n水属性の味方のＴＰ上昇を増加する領域を作り、連射攻撃\nで敵の防御を撃ち抜くことで七冠の力を敵に知らしめる。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/02/28 11:59:59", 2.09, 0, 2, 0, "ねねか", 3, 0, 450, 0, 133801, 7, 133801, 133801, 0, 759, "2025/02/20 12:00:00", "ネネカ（アルファ）", 0, 0, 133801, "【魔法】後衛から、始原の姿で戦況を操る『変貌大妃』。\n召喚したグレゴールから攻撃支援とＴＰ回復を受け、互い\nの魔力を合わせた連携攻撃で、幽玄なる玉座に君臨する。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/02/20 11:59:59", 2.09, 0, 1, 0, "くりすてぃーな", 3, 0, 450, 0, 133901, 6, 133901, 133901, 0, 228, "2025/02/10 12:00:00", "クリスティーナ（アルファ）", 0, 0, 133901, "【物理】前衛で、始原の冠装の力を振るう『誓約女君』。\n10行動目に攻撃力を大幅アップし、スキルに追撃を発生\nさせる【虚数】を得て隔絶した力で楯突く敵を抹消する。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/05/03 18:59:59", 2.09, 0, 2, 0, "ふぃお", 3, 0, 450, 0, 134001, 0, 134001, 134001, 0, 746, "2025/04/30 12:00:00", "フィオ", 0, 0, 134001, "【魔法】後衛で、アストルムの冒険へと導くガイド妖精。\nバフとバリアで味方を護りバリアを起点とする攻撃支援、\n風属性の味方への行動速度とＴＰの支援で仲間を支える。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2030/12/31 15:00:00", 0.0, 0, 0, 0, "ふぶき", 3, 0, 0, 1, 134101, 5, 0, 0, 0, 0, "2015/04/01 15:00:00", "フブキ", 0, 0, 134101, "");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2030/12/31 15:00:00", 0.0, 0, 0, 0, "らいらえる", 3, 0, 0, 1, 134201, 7, 0, 0, 0, 0, "2015/04/01 15:00:00", "ライラエル（クリスマス）", 0, 0, 134201, "");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/03/15 14:59:59", 2.09, 0, 2, 0, "らんふぁ", 3, 0, 450, 0, 134301, 7, 134301, 134301, 0, 778, "2025/03/03 19:00:00", "ランファ（儀装束）", 0, 0, 134301, "【魔法】後衛で儀装束を纏い精霊と心を通わせる唱喚士。\n敵の数に応じてダメージ量が変化する範囲攻撃や、魔法\n無効バリアなどの支援スキルで想いを詩に乗せ響かせる。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 0, "2030/12/31 15:00:00", 2.09, 0, 2, 0, "ちか", 3, 0, 450, 21, 134401, 7, 134401, 134401, 0, 773, "2025/03/15 15:00:00", "チカ（儀装束）", 0, 0, 134401, "【魔法】後衛で儀装束を纏い歌を紡ぎ伝えていく唱喚士。\n自分と最も近くの味方へ強力なバフとＴＰ回復を行うこと\nで攻撃を支援し、共に心を通わせ美しき旋律を奏でる。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/04/15 14:59:59", 2.09, 0, 2, 0, "くろーちぇ", 3, 0, 450, 0, 134501, 0, 134501, 134501, 0, 719, "2025/04/08 12:00:00", "クローチェ（エアリアル）", 0, 0, 134501, "【魔法】後衛で超速飛行からの大火力を叩き込むロボ娘。\n上空から速度バフで味方全体を支援しつつ、自分のバリア\nを解除して力へと変え、世界の命運を背負い飛翔する！");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/04/08 11:59:59", 2.09, 0, 1, 0, "あおい", 3, 0, 450, 35, 134601, 35, 134601, 134601, 0, 526, "2025/03/31 12:00:00", "アオイ（パイロット）", 0, 0, 134601, "【物理】中衛で巨大ロボを駆り戦うぼっちのパイロット。\n敵の弱体化や、味方へバリアを展開するスキルを持ち、\n鋼鉄の乙女から放つ光線はいかに堅固な守りも打ち破る。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/04/26 11:59:59", 2.09, 0, 1, 0, "ほうおう", 3, 0, 450, 7, 134701, 7, 134701, 134701, 0, 490, "2025/04/15 15:00:00", "ホウオウ", 0, 0, 134701, "【物理】中衛で、華麗に舞い踊る五色絢爛な煉華の鳳凰。\n攻撃力バフやバリア展開などの攻防支援と、多彩で豊富な\nＨＰ・ＴＰ供給を両立し、浄化の力で皆に安寧を授ける。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 0, "2030/12/31 15:00:00", 0.0, 0, 0, 0, "めどぅーさ", 1, 0, 0, 1, 136601, 1, 0, 0, 0, 0, "2015/04/01 15:00:00", "メドゥーサ", 0, 0, 136601, "");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2030/12/31 15:00:00", 0.0, 0, 0, 0, "らびりすた", 3, 0, 0, 1, 136701, 8, 0, 0, 0, 0, "2015/04/01 15:00:00", "ラビリスタ（アルファ）", 0, 0, 136701, "");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2030/12/31 15:00:00", 0.0, 0, 0, 0, "らんふぁ", 3, 0, 0, 1, 136801, 7, 0, 0, 0, 0, "2015/04/01 15:00:00", "ランファ（儀装束）", 0, 0, 136801, "");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 0, "2030/12/31 15:00:00", 1.965, 0, 1, 0, "じーた", 3, 0, 450, 34, 170101, 34, 170101, 105701, 4, 245, "2015/04/01 15:00:00", "ジータ", 0, 0, 170101, "【物理】前衛で、先手必勝の大技を繰り出す騎空士。\nスキルによるＴＰ回復は、ユニオンバーストの発動を早め\nバトルの序盤から敵前衛に大ダメージを与える。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/05/03 18:59:59", 1.62, 0, 1, 0, "ひより", 3, 0, 450, 0, 180101, 0, 180101, 180101, 7, 199, "2025/04/30 12:00:00", "ヒヨリ（プリンセス）", 0, 0, 180101, "【物理】前衛で炎翼を背に敵を粉砕する、陽気な元気娘。\n戦いが続く程に自身の攻撃能力を強めるスキルを操り、\n高めた力で放つ超爆の一撃は、あらゆる敵を塵と化す。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/05/03 18:59:59", 1.92, 0, 2, 0, "ゆい", 3, 0, 450, 0, 180201, 0, 180201, 180201, 1, 767, "2025/04/30 12:00:00", "ユイ（プリンセス）", 0, 0, 180201, "【魔法】後衛から極大魔法で敵を滅する願いの魔法士。\nＴＰを回復しつつ攻撃力を累積アップする補助スキルで\n自身の力を高め、強力な範囲攻撃を放ち敵を一掃する。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/05/03 18:59:59", 1.965, 0, 1, 0, "れい", 3, 0, 450, 0, 180301, 0, 180301, 180301, 7, 377, "2025/04/30 12:00:00", "レイ（プリンセス）", 0, 0, 180301, "【物理】中衛で風刃を従え激戦を流麗に征く嵐翼の剣士。\n敵が多い程に効果が高まる自己強化スキルで、自身を奮い\n立たせ、強力な範囲攻撃スキルで一切の敵を鏖滅する。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/05/03 18:59:59", 1.965, 0, 1, 0, "ぺこりーぬ", 3, 0, 450, 0, 180401, 0, 180401, 180401, 1, 155, "2025/04/30 12:00:00", "ペコリーヌ（プリンセス）", 0, 0, 180401, "【物理】前衛で、攻防共に絶大な力を誇る腹ペコ王女。\nＨＰが多い時は爆発的な攻撃力で、いかなる敵をも屠り、\nＨＰが減ると自己回復能力を得て、鉄壁の護りを見せる。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/05/03 18:59:59", 2.14, 0, 1, 0, "こっころ", 3, 0, 450, 0, 180501, 0, 180501, 180501, 1, 555, "2025/04/30 12:00:00", "コッコロ（プリンセス）", 0, 0, 180501, "【物理】中衛で、絶大な補助スキルを繰出す純白の巫女。\n味方の攻撃力とクリティカルダメージを強化しつつ、\n二つの全体回復スキルで味方を堅固に守護し勝利へ導く。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/05/03 18:59:59", 1.92, 0, 2, 0, "きゃる", 3, 0, 450, 0, 180601, 0, 180601, 180601, 1, 747, "2025/04/30 12:00:00", "キャル（プリンセス）", 0, 0, 180601, "【魔法】後衛で、極大魔法を操り敵を討つ姫装の猫娘。\n回復や補助を兼ねた各攻撃スキルを駆使し戦況を整え、\n極大威力のユニオンバーストを撃ち込み敵を燼滅する。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/05/03 18:59:59", 1.75, 0, 1, 0, "はつねしおり", 3, 0, 450, 0, 180701, 0, 180701, 180701, 1, 732, "2025/04/30 12:00:00", "ハツネ＆シオリ", 0, 0, 180701, "【物理】後衛から、真の絆の力を発揮する仲良し姉妹。\n敵の数が増えるほど威力が高まる攻撃スキルと、周りの\n味方を強化するスキルを操り、立ち塞がる敵を一掃する。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/05/03 18:59:59", 1.5, 0, 1, 0, "みそぎみみきょうか", 3, 0, 450, 0, 180801, 0, 180801, 180801, 1, 465, "2025/04/30 12:00:00", "ミソギ＆ミミ＆キョウカ", 0, 0, 180801, "【物理】中衛で敵単体に必殺の一撃を放つ仲良しトリオ。\n３人の力を合わせて放つ攻撃は、相手の弱点に合わせて\n物理から魔法攻撃に変化し、どんな強い敵も退治する！");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/05/03 18:59:59", 2.09, 0, 1, 0, "あきのされん", 3, 0, 450, 0, 180901, 0, 180901, 180901, 1, 421, "2025/04/30 12:00:00", "アキノ＆サレン", 0, 0, 180901, "【物理】中衛で背を預けあう最高の好敵手で親友の二人。\n味方の物理攻撃をサポートしつつＨＰとＴＰを継続回復し\nＨＰが多いほど威力が増すＵＢで、共に勝利の道を征く。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/05/03 18:59:59", 2.09, 0, 2, 0, "あんぐれあ", 3, 0, 450, 0, 181001, 0, 181001, 181001, 1, 577, "2025/04/30 12:00:00", "アン＆グレア", 0, 0, 181001, "【魔法】中衛で、魔力共鳴し連撃を放つマナリアの双姫。\nステータスアップ効果を受けると増加する【友情の魔印】\nがスキルを強化し、波長を合わせた炎の魔槍で敵を討つ。");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/05/03 18:59:59", 1.92, 0, 1, 0, "しずるりの", 3, 0, 450, 0, 181101, 0, 181101, 181101, 1, 551, "2025/04/30 12:00:00", "シズル＆リノ", 0, 0, 181101, "【物理】中衛でお揃い衣装の、真偽を超えた仲良し姉妹。\n攻守共に味方を支えるシズルと、クリティカル時に強力な\nダメージを与えるリノ、姉妹の絆で困難を跳ね除ける！");
INSERT INTO `v1_85343c90b3fcd1c188c9526e5c4604913f87e04846d886eea23f3151acd060d4` VALUES (0, 1, "2025/05/03 18:59:59", 1.92, 0, 1, 0, "しぇふぃ", 3, 0, 450, 0, 181201, 0, 181201, 181201, 1, 368, "2025/04/30 12:00:00", "シェフィ（プリンセス）", 0, 0, 181201, "【物理】中衛で新たな力と共に再廻する姫装の氷竜少女。\n環境効果【絶氷】でクリティカルダメージを高め、火力と\n手数を併せ持つ剣技で、再び共に歩むため道を切り開く。");
